window.bookSummaryJSON = "<p>Max Shannon is a good cop, one of the best in New York Enforcement. Born with a natural shield that protects him against Psy mental invasions, he knows he has little chance of advancement within the Psy-dominated power structure. The last case he expects to be assigned is that of a murderer targeting a Psy Councilor's closest advisors. And the last woman he expects to compel him in the most sensual of ways is a Psy on the verge of a catastrophic mental fracture.</p>"; 
